update tick set tick_situacao = 'Finalizado' where tick_id between 50 and 65;
update tick set tick_situacao = 'Em Espera' where tick_id between 130 and 137;
update tick set tick_situacao = 'Em Andamento' where tick_id between 380 and 399;
update tick set tick_situacao = 'Baixado' where tick_id not between 50 and 65 and
					                                      tick_id not between 130 and 137 and
					                                      tick_id not between 380 and 399 ;




